import classes from "./CityLists.module.css";

const CityLists = () => {
  const Dummy_City = [
    {
      name: "Dublin",
      subText: "123 properties",
      image: "./images/city_1.webp",
    },
    {
      name: "Reno",
      subText: "533 properties",
      image: "./images/city_2.webp",
    },
    {
      name: "Austin",
      subText: "532 properties",
      image: "./images/city_3.webp",
    },
  ];
  return (
    <div>
      <div>
        <div className={classes.text}>
          <h3>{Dummy_City[0].name}</h3>
          <h3>{Dummy_City[0].subText}</h3>
        </div>
        <img src={Dummy_City[0].image} alt={Dummy_City[0].name} />
      </div>

      <div>
        <div>
          <h3>{Dummy_City[1].name}</h3>
          <h3>{Dummy_City[1].subText}</h3>
        </div>
        <img src={Dummy_City[1].image} alt={Dummy_City[1].name} />
      </div>
      <div>
        <div>
          <h3>{Dummy_City[2].name}</h3>
          <h3>{Dummy_City[2].subText}</h3>
        </div>
        <img src={Dummy_City[2].image} alt={Dummy_City[2].name} />
      </div>
    </div>
  );
};
export default CityLists;
